import React from 'react'
import { Card , Button } from 'react-bootstrap';


const CardMenu = (props) => {
  const { src, title, tipo, cardON, cardOFF, btnON, btnOFF } = props;
  
  return (
    <Card className={`col-3 card pt-3 rounded-3 ${cardON, cardOFF, tipo}`} style={{ width: '15rem', height:  '17rem' }}>
      <Card.Img src={src} alt="..." style={{ width: '10rem', alignSelf: 'center'}} />
      <Card.Body>
        <Card.Title>{title}</Card.Title>
        <Button variant='danger' className={`${btnON, btnOFF  }`}>Acesse</Button>
      </Card.Body>
    </Card>
  );
}

export default CardMenu
